import { Link } from "react-scroll";
function Header() {

  function openBar() {
    const bar = document.querySelector(".bar");

    bar.classList.toggle("opened");
  }

  return (
    <header>
      <video src="./video.mp4" loop autoPlay muted></video>
      <h1>Open Source Website</h1>
      <div className="row">

        <Link
        onClick={openBar}
        to="about-scroll"
        spy={true}
        smooth={true}
        duration={1000}
        activeClass="active"
      >

      <button className="btn" style={{ cursor: "pointer" }}>
      Product </button>
        </Link>

        <Link
        onClick={"https://wa.me/message/DDFS53IPYRVRE1"}
        to="https://wa.me/message/DDFS53IPYRVRE1"
        spy={true}
        smooth={true}
        duration={1000}
        activeClass="active"
      >

      <button className="btn" style={{ cursor: "pointer" }}>
      Contact us </button>
        </Link>
      </div>

      <div className="headerbg"></div>
    </header>
  );
}
export default Header;
